import React from 'react';
import ReactDOM from 'react-dom/client';

import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

import { Dashboard } from './dashboard/dashboard'
import { NewCustomer } from './new-customer/new-customer'
import { Deposit } from './deposit/deposit'
import { Withdraw } from './withdraw/withdraw'
import './index.css'
import { BankerLogin } from './'
import { Accounts } from './banker/accounts';
import { Transactions } from './banker/transactions';

import { Transfer } from './transfer/transfer'
import { Balance } from './balance/balance'
import BankerRegister from './banker/BankerRegister';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
     <Routes>
      <Route path="/" element={<Dashboard />} />
      <Route path="/new" element={<NewCustomer />} />
      <Route path="/deposit" element={<Deposit />} />
      <Route path="/withdraw" element={<Withdraw />} />
      <Route path="/transfer" element={<Transfer />} />
      <Route path="/balance" element={<Balance />} />
        <Route path="/banker-login" element={<BankerLogin />} />
          <Route path="/banker-register" element={<BankerRegister />} />
    <Route path="/accounts" element={<Accounts />} />
    <Route path="/transactions/:accountNumber" element={<Transactions />} />
    </Routes>
  </BrowserRouter>
);
